import React, { useState } from "react"
import axios from "axios"
import { SERVER_HOST } from "../config/global_constants"

const ProductTableRow = (props) => {
    const [quantity, setQuantity] = useState(1)
    const [showModal, setShowModal] = useState(false)
    const [modalMessage, setModalMessage] = useState("")

    const increaseQuantity = () => {
        setQuantity(quantity + 1)
    }

    const decreaseQuantity = () => {
        if (quantity > 1) {
            setQuantity(quantity - 1)
        }
    }

    const handleQuantityChange = (e) => {
        const value = parseInt(e.target.value)
        if (value > 0) {
            setQuantity(value)
        }
    }

    const addToCart = () => {
        axios.post(`${SERVER_HOST}/cart/add/${props.product._id}/${quantity}`)
            .then(res => {
                setModalMessage(`${quantity} x ${props.product.name} added to cart!`)
                setShowModal(true)
                setQuantity(1)

                // Auto-close modal after 2 seconds
                setTimeout(() => {
                    setShowModal(false)
                }, 2000)
            })
            .catch(err => {
                console.error("Error adding to cart:", err)
                setModalMessage("Failed to add to cart. Please try again.")
                setShowModal(true)
            })
    }

    const closeModal = () => {
        setShowModal(false)
    }

    return (
        <>
            <tr>
                <td>
                    <div style={{ display: "flex", justifyContent: "center", alignItems: "center" }}>
                        <i
                            className={props.isFavorite ? "fa-solid fa-heart" : "fa-regular fa-heart"}
                            style={{
                                color: props.isFavorite ? "#e74c3c" : "#aaa",
                                cursor: "pointer",
                                fontSize: "1.6rem"
                            }}
                            onClick={props.onFavoriteClick}
                            title={props.isFavorite ? "Remove from favorites" : "Add to favorites"}
                        ></i>
                    </div>
                </td>
                <td>{props.product.name}</td>
                <td>{props.product.category}</td>
                <td>{props.product.energyRating}</td>
                <td>â‚¬{props.product.price}</td>
                <td>
                    <div style={{ display: "flex", alignItems: "center", gap: "5px" }}>
                        <button onClick={decreaseQuantity} className="button-minus">
                            -
                        </button>
                        <input 
                            type="number" 
                            value={quantity}
                            onChange={handleQuantityChange}
                            min="1"
                            style={{ 
                                width: "50px", 
                                textAlign: "center",
                                padding: "5px",
                                WebkitAppearance: "none",
                                MozAppearance: "textfield"
                            }}
                        />
                        <button onClick={increaseQuantity} className="button-plus">
                            +
                        </button>
                    </div>
                </td>
                <td>
                    <button className="green-button" onClick={addToCart}>
                        Add to Cart
                    </button>
                </td>
            </tr>

            {/* Modal */}
            {showModal && (
                <div style={{
                    position: "fixed",
                    top: 0,
                    left: 0,
                    width: "100%",
                    height: "100%",
                    backgroundColor: "rgba(0, 0, 0, 0.5)",
                    display: "flex",
                    justifyContent: "center",
                    alignItems: "center",
                    zIndex: 1000
                }}>
                    <div style={{
                        backgroundColor: "white",
                        padding: "30px",
                        borderRadius: "8px",
                        boxShadow: "0 4px 6px rgba(0, 0, 0, 0.1)",
                        maxWidth: "400px",
                        textAlign: "center",
                        position: "relative"
                    }}>
                        <div style={{
                            fontSize: "48px",
                            color: "#28a745",
                            marginBottom: "15px"
                        }}>
                            {modalMessage}
                        </div>
                        <h3 style={{ marginBottom: "15px", color: "#333" }}>Added to cart</h3>
                        <p style={{ marginBottom: "20px", color: "#666" }}>{modalMessage}</p>
                    </div>
                </div>
            )}
        </>
    )
}

export default ProductTableRow
